description:
Claire Castel - Scandalous Girl 
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: To make this a truly special event, the young libertine, famous for her scandalous sexuality, has chosen a most appropriate theme: lust. After sending out invitations to her hottest, most beautiful girlfriends, Claire is still wondering what wild perversions will take place in this luxurious Parisian apartment tonight... Claire has called on Anissa's talents, famous for organizing libertine parties. A gorgeous busty brunette, Anissa is an irresistible seductress and loves having wild passionate sex with several partners, men as well as women. For an event like this, she always comes surrounded by beautiful friends...when Lola, a blonde with a perfect body, enters the bedroom during the evening, she is both surprised and tantalized to discover Anissa and two of her girlfriends in the company of one man. Without hesitating, Anissa invites Lola to join them...

Cast: Claire Castel, Anissa Kate, Ash Hollywood, Lola Reve, Lilith Marshall, Henessy (II), Ava Courcelles, James Brossman, Mike Angelo, Renato, J.P.X., Rico Simmons, Marc Dorcel ProducerHerve Bodilis,Director

